import {useEffect,useState} from 'react'
import s from './TopColorBar.module.scss'
import { useRouter } from "next/router";

const Form = ({text}) => {
   const [Navbar, setNavbar] = useState(false)
   const router = useRouter();

	const goHome = () => {
		const fullPath = `/`;
		router.push(fullPath);
	};

   useEffect(() => {
      changeBackground()
      // adding the event when scroll change Logo
      window.addEventListener("scroll", changeBackground)
    })

   const changeBackground = () => {

      if (window.scrollY >= 60) {
        setNavbar(true)
 
      } else {
         setNavbar(false)
      }
    }

   return (
      <>
      {
         Navbar
         ?
         <>
        
         <div className={s.container} style={{backgroundColor:"rgba(0, 0, 0, 0.637)"}}>
{/*          
         <div className={s.back_to_home} onClick={goHome}>
					<span>{miniLogo}</span>
					<span className={s.minilogo_names}>
						<div>HANG KUCHEN </div>
						<div>SPORDELER <span> &</span> </div>
                  <div>RODRIGUEZ MORALES </div>
					</span>
				</div> */}
         </div>
         </>

         :
         <div className={s.container}>

         <div className={s.back_to_home} onClick={goHome}>
					<span>{miniLogo}</span>
					{/* <span className={s.minilogo_names}>
						<div>HANG KUCHEN </div>
						<div>SPORDELER <span> &</span> </div>
                  <div>RODRIGUEZ MORALES </div>
					</span> */}
				</div>
    
         
         </div>
      }

        
      </>
   );
}

export default Form;

